import React from 'react';

import HeaderButtons from './Components/HeaderButtons';
import HeaderTitle from './Components/ClickableDiv';
import circlePlaceholder from './Icons/circlePlaceholder.png';
import rectanglePlaceholder from './Icons/isacantarerosoftwareengineertitle.png';

const FirstPage = () => (
  <div className="min-h-screen bg-gray-50"> {/* Full viewport background */}

    {/* First Section: Header */}
    <div className="flex justify-between items-center px-6 py-4 bg-white shadow-md">
      <HeaderButtons 
        image={circlePlaceholder}
        description="LinkedIn" 
        url="https://www.linkedin.com/in/isa-cantarero-525306b5/"
      />

      <HeaderTitle 
        title="ISA CANTARERO"
        text="Software Engineer"
        url="https://www.isacantarero.com"
      />

      <HeaderButtons 
        image={circlePlaceholder}
        description="Message Me!" 
        url="https://www.anatefrati.com/"
      />
    </div>

    {/* Second Section: Centered Image */}
    <div className="flex justify-center my-8">
      <img src={circlePlaceholder} alt="Placeholder" className="w-48 h-48 rounded-full object-cover" />
    </div>

    {/* Third Section: Content */}
    <div className="flex justify-around items-start px-4 py-6 bg-gray-100">

      {/* Left Section: Image + Text */}
      <div className="max-w-sm text-center">
        <img src="https://via.placeholder.com/200" alt="Placeholder" className="w-full rounded-lg" />
        <p className="mt-4 text-gray-700">Some descriptive text goes here.</p>
      </div>

      {/* Right Section: Stacked Buttons */}
      <div className="flex flex-col space-y-4">
        <button className="bg-red-500 text-white px-4 py-2 rounded w-full hover:bg-red-600">Button A</button>
        <button className="bg-yellow-500 text-white px-4 py-2 rounded w-full hover:bg-yellow-600">Button B</button>
        <button className="bg-purple-500 text-white px-4 py-2 rounded w-full hover:bg-purple-600">Button C</button>
      </div>

    </div>
  </div>
);

export default FirstPage;
